import * as PIXI from 'pixi.js'
class Stage extends PIXI.Container {
	private child: PIXI.DisplayObject

	constructor() {
		super()
	}
	public contains(child: PIXI.DisplayObject) {
		return this.children.indexOf(child) !== -1
	}
}
export default Stage
